#!/usr/bin/octave -qf

% Define the congruence equation
a = 64;
b = 2;
n = 66;

% Calculate the number of solutions
num_solutions = gcd(a, n);

% Check if the congruence has a solution
if (num_solutions == 1)
  % Calculate the modular inverse of a
  inv_a = modinv(a, n);

  % Calculate the solution
  x = mod(b * inv_a, n);

  % Check if the solution is within the given range
  if (x > 0 && x <= 100)
    % Print the solution
    printf('%.15g\n', x);
  else
    % Print "No solution" if the solution is not within the given range
    printf('No solution\n');
  endif
else
  % Print "No solution" if the congruence has no solution
  printf('No solution\n');
endif
