function result = count_numbers(min_base3, max_base3, min_base6, max_base6)
  result = 0;
  for base3 = min_base3:max_base3
    for base6 = min_base6:max_base6
      if (base3 < 3) || (base3 > 9) || (base6 < 6) || (base6 > 9)
        continue;
      endif
      if (base3 == 3) && (base6 == 6)
        result++;
      endif
    endfor
  endfor
endfunction

