function value = pascal_triangle(n)
  value = zeros(n);
  value(1, 1) = 1;
  for i = 2:n
    value(i, 1) = value(i - 1, 1);
    value(i, i) = value(i - 1, i - 1);
    for j = 2:i
      value(i, j) = value(i - 1, j - 1) + value(i - 1, j);
    endfor
  endfor
endfunction

