octave_code:
function least_prime_sum_of_squares()
  % Initialize variables
  n = 1;
  prime = false;
  sum_of_squares = false;

  % Loop until the least prime sum of squares is found
  while ~prime
    % Check if the sum of two distinct positive perfect squares is prime
    for i = 1:n
      for j = 1:n
        if i != j
          sum_of_squares = isprime(i^2 + j^2);
          if sum_of_squares
            prime = true;
            break;
          endif
        endif
      endfor
    endfor
    n++;
  endwhile

  % Print the least prime sum of squares
  printf('%.15g\n', n);
endfunction

least_prime_sum_of_squares();

