function [result] = smallest_five_digit_divisible_by_digits()
  % Initialize the smallest five-digit number with all different digits
  num = 10000;

  % Loop until we find a number that is divisible by each of its non-zero digits
  while true
    % Check if the number is divisible by each of its non-zero digits
    if all(mod(num, [1:9]) == 0)
      % If the number is divisible by each of its non-zero digits, return it
      result = num;
      break;
    endif

    % Increment the number by 1
    num++;
  endwhile
endfunction

% Print the result
printf('%.15g\n', smallest_five_digit_divisible_by_digits());

