question:
The parabola $y = ax^2 + bx + c$ crosses the $x$-axis at $(p,0)$ and $(q,0),$ both to the right of the origin.  A circle also passes through these two points.  Let $t$ be the length of the tangent from the origin to the circle.  Express $t^2$ in terms of one or more of the coefficients $a,$ $b,$ and $c.$

[asy]
unitsize(3 cm);

pair A, O, T;

real func (real x) {
  return ((x - 1)*(x - 2));
}

A = (1.5,-0.4);
O = (0,0);
T = intersectionpoint(Circle(A,abs(A - (1,0))),arc(A/2,abs(A)/2,0,90));

draw(graph(func,0.5,2.5));
draw((-0.5,0)--(2.5,0));
draw((0,-1)--(0,1));
draw(Circle(A,abs(A - (1,0))));
draw(O--T);

label("$t$", T/3, N);

dot(T);
[/asy]

octave_code:
#!/usr/bin/octave -qf

# Define the coefficients of the parabola
a = 1;
b = -3;
c = 2;

# Find the roots of the parabola
p = roots([a b c]);
q = p(2);

# Calculate the center of the circle
center_x = (p + q) / 2;
center_y = -a * center_x^2 - b * center_x - c;

# Calculate the radius of the circle
radius = sqrt((center_x - p)^2 + center_y^2);

# Calculate the length of the tangent
t = sqrt(radius^2 - center_y^2);

# Print the result
printf('%.15g\n', t^2);

