function result = find_nice_numbers()
  % Define the range
  range = 2010:2019;

  % Initialize the sum
  sum = 0;

  % Loop through each number in the range
  for i = range
    % Check if the number is nice
    if is_nice(i)
      % Add the number to the sum
      sum = sum + i;
    endif
  endfor

  % Print the result
  printf('%.15g\n', sum);
endfunction

function is_nice = is_nice(n)
  % Find the divisors of n
  divisors = divisors(n);

  % Check if there are exactly four divisors
  if length(divisors) != 4
    is_nice = false;
    return;
  endif

  % Check if the sum of the divisors is equal to n
  if sum(divisors) != n
    is_nice = false;
    return;
  endif

  % If all checks pass, the number is nice
  is_nice = true;
endfunction

function divisors = divisors(n)
  % Initialize the divisors array
  divisors = [];

  % Loop through each potential divisor
  for i = 1:sqrt(n)
    % Check if i is a divisor
    if mod(n, i) == 0
      % Add i and the quotient to the divisors array
      divisors = [divisors, i, n/i];
    endif
  endfor

  % Sort the divisors array
  divisors = sort(divisors);
endfunction

