function count_triplets()
  % Define the polynomial
  p = [1, 0, 0, 0];

  % Find the roots of the polynomial
  roots = roots(p);

  % Check if the roots are rational
  if all(isrational(roots))
    % If the roots are rational, count the number of triplets
    count = length(roots);
  else
    % If the roots are not rational, set the count to 0
    count = 0;
  end

  % Print the result
  printf('%.15g\n', count);
end

% Call the function
count_triplets();

