function [] = solve_quadratic_equations()
  % Define the coefficients of the quadratic equations
  a1 = 1988;
  b1 = 8891;
  a2 = 8891;
  b2 = 1988;

  % Calculate the discriminants of the quadratic equations
  d1 = b1^2 - 4*a1*b2;
  d2 = b2^2 - 4*a2*b1;

  % Check if the discriminants are non-negative
  if d1 >= 0 && d2 >= 0
    % Calculate the roots of the quadratic equations
    r1 = (-b1 + sqrt(d1)) / (2*a1);
    r2 = (-b1 - sqrt(d1)) / (2*a1);
    r3 = (-b2 + sqrt(d2)) / (2*a2);
    r4 = (-b2 - sqrt(d2)) / (2*a2);

    % Check if the roots are equal
    if r1 == r3 || r1 == r4 || r2 == r3 || r2 == r4
      % Calculate the value of b
      b = -(a1*r1 + a2*r1);
      printf('%.15g\n', b);
    end
  end
end

