function x = find_second_smallest_integer()
  x = 1;
  while true
    if is_terminating_decimal(x)
      if x > 1
        printf('%.15g\n', x);
        break;
      endif
    endif
    x++;
  endwhile
endfunction

function is_terminating_decimal = is_terminating_decimal(x)
  is_terminating_decimal = false;
  for i = 1:x
    if mod(x^2 + x, 10) == 0
      is_terminating_decimal = true;
      break;
    endif
  endfor
endfunction

find_second_smallest_integer();

