function [] = solve_largest_k()
  % Define the polynomials Q1 and Q2
  Q1 = [1, k - 29, -k];
  Q2 = [2, 2*k - 43, k];

  % Find the roots of Q1 and Q2
  roots_Q1 = roots(Q1);
  roots_Q2 = roots(Q2);

  % Check if the roots are real and distinct
  if all(isreal(roots_Q1)) && all(isreal(roots_Q2)) && all(roots_Q1 ~= roots_Q2)
    % If the roots are real and distinct, find the largest k
    k_max = max(k);
    printf('%.15g\n', k_max);
  else
    % If the roots are not real or not distinct, print an error message
    printf('Error: Roots are not real or not distinct\n');
  end
end

