question:
A circular sector has fixed perimeter, but the central angle $\theta$ and radius $r$ are allowed to vary.

[asy]
unitsize(2 cm);

pair A, B, O;

A = (1,0);
B = dir(110);
O = (0,0);

draw(A--O--B);
draw(arc(O,1,0,110));

label("$r$", (O + A)/2, S);
label("$r$", (O + B)/2, SW);
label("$\theta$", (0.1,0.15));
[/asy]

Which central angle $\theta$ maximizes the area of the circular sector?  Give the answer in radians.

Note: The arc length of the sector is $r \theta,$ and the area of the sector is $\frac{r^2 \theta}{2}.$

octave_code:
function max_area_theta()
  % Define the fixed perimeter
  p = 10;

  % Define the function to maximize
  f = @(r, theta) r^2 * theta / 2;

  % Define the constraint function
  g = @(r, theta) 2 * r + r * theta - p;

  % Use fmincon to find the maximum area
  options = optimoptions('fmincon','Display','iter');
  [r, theta] = fmincon(f, [1, 1], [], [], [], [], [0, 0], [Inf, Inf], g, options);

  % Print the result
  printf('%.15g\n', theta);
end

max_area_theta()

