function [prime_count] = count_primes_in_factorial(n)
  # Initialize a vector to store the prime factors
  prime_factors = zeros(1, n);

  # Initialize a variable to store the current number
  current_number = 2;

  # Loop through the numbers from 2 to n
  for i = 2:n
    # If the current number is prime, add it to the prime factors vector
    if isprime(current_number)
      prime_factors(i) = current_number;
    endif

    # Increment the current number
    current_number++;
  endfor

  # Remove duplicates from the prime factors vector
  prime_factors = unique(prime_factors);

  # Return the number of unique prime factors
  prime_count = length(prime_factors);
endfunction

# Call the function with n = 20
prime_count = count_primes_in_factorial(20);

# Print the result
printf('%.15g\n', prime_count);

