function [] = least_sum_of_distinct_positive_integers()
  % Define the product
  product = 84;

  % Initialize the sum
  sum = 0;

  % Loop through all possible factors of the product
  for i = 1:product
    % Check if the product is divisible by the current factor
    if mod(product, i) == 0
      % Add the current factor to the sum
      sum = sum + i;
      % Remove the current factor from the product
      product = product / i;
      % Break the loop
      break;
    endif
  endfor

  % Print the least possible sum
  printf('%.15g\n', sum);
endfunction

% Call the function
least_sum_of_distinct_positive_integers();

