  % Define the function to maximize
  f = @(x, y, z) x.*y.*z./((1 + 5.*x).*(4.*x + 3.*y).*(5.*y + 6.*z).*(z + 18));

  % Define the domain
  x = 0:0.01:10;
  y = 0:0.01:10;
  z = 0:0.01:10;

  % Initialize the maximum value
  max_value = -inf;

  % Loop through the domain
  for i = 1:length(x)
    for j = 1:length(y)
      for k = 1:length(z)
        % Calculate the function value
        value = f(x(i), y(j), z(k));

        % Update the maximum value
        if value > max_value
          max_value = value;
        end
      end
    end
  end

  % Print the maximum value
  printf('%.15g\n', max_value);
end

