% Define the points A and B
A = [2, 2];
B = [7, 7];

% Define the function to check if a point C is in the region R
function isInRegion = isInRegion(C)
    % Calculate the vectors AB and AC
    AB = B - A;
    AC = C - A;

    % Calculate the dot product of AB and AC
    dotProduct = AB * AC';

    % Check if the dot product is positive and the angle between AB and AC is acute
    if dotProduct > 0 && acos(dotProduct / (norm(AB) * norm(AC))) < pi/2
        isInRegion = true;
    else
        isInRegion = false;
    end
end

% Define the function to calculate the area of the region R
function area = calculateArea(lowerLeft, upperRight)
    % Define the grid size
    gridSize = 1000;

    % Initialize the area to 0
    area = 0;

    % Loop through the grid
    for i = 1:gridSize
        for j = 1:gridSize
            % Calculate the point C
            C = [i, j];

            % Check if the point C is in the region R
            if isInRegion(C)
                % Add the area of the square to the total area
                area = area + 1;
            end
        end
    end

    % Calculate the area of the region R
    area = area / (gridSize * gridSize);
end

% Calculate the area of the region R
area = calculateArea([1, 1], [gridSize, gridSize]);

% Print the final answer
printf('%.15g\n', area);

