#!/usr/bin/octave -qf

function result = count_permutations(word)
  unique_letters = unique(word);
  total_letters = length(word);
  factorial_total_letters = factorial(total_letters);
  factorial_unique_letters = factorial(length(unique_letters));
  result = factorial_total_letters / factorial_unique_letters;
endfunction

function result = count_permutations_starting_with_b(word)
