function max_value = find_max_value()
  % Define the function
  f = @(x) 4 * (x + 7) * (2 - x);

  % Find the derivative of the function
  df = @(x) 4 * (2 - x) - 4 * (x + 7);

  % Set the initial guess for the maximum value
  x_guess = 0;

  % Set the tolerance for the convergence
  tolerance = 1e-10;

  % Set the maximum number of iterations
  max_iterations = 1000;

  % Set the initial value of the function
  f_value = f(x_guess);

  % Set the initial value of the derivative
  df_value = df(x_guess);

  % Set the initial value of the iteration counter
  iteration = 0;

  % Loop until the convergence is achieved
  while abs(df_value) > tolerance && iteration < max_iterations
    % Update the value of x
    x_guess = x_guess - f_value / df_value;

    % Update the value of the function
    f_value = f(x_guess);

    % Update the value of the derivative
    df_value = df(x_guess);

    % Increment the iteration counter
    iteration = iteration + 1;
  end

  % Print the maximum value
  printf('%.15g\n', f_value);
end

% Call the function
find_max_value();

