question:
Let \[f(x) =
\begin{cases}
5x^2+2&\text{if } x\le a, \\
11x &\text{if } x>a.
\end{cases}
\]Find the smallest possible value for $a$ if the graph of $y=f(x)$ is continuous (which means the graph can be drawn without lifting your pencil from the paper).

octave_code:
function [] = find_smallest_a()
  % Define the function f(x)
  f = @(x) piecewise(x <= a, 5*x.^2 + 2, x > a, 11*x);

  % Define the derivative of f(x)
  df = @(x) piecewise(x <= a, 10*x, x > a, 11);

  % Find the smallest possible value for a
  a = fzero(@(a) df(a), 0);

  % Print the result
  printf('%.15g\n', a);
end

