function result = calculate_probability()
  % Define the number of trials for each coin
  num_trials_A = 3;
  num_trials_B = 2;

  % Calculate the total number of outcomes for each coin
  total_outcomes_A = 2^num_trials_A;
  total_outcomes_B = 2^num_trials_B;

  % Calculate the number of favorable outcomes for each coin
  favorable_outcomes_A = sum(binopdf(0:num_trials_A, num_trials_A, 0.5));
  favorable_outcomes_B = sum(binopdf(0:num_trials_B, num_trials_B, 0.5));

  % Calculate the probability of more heads using coin A than coin B
  probability = (favorable_outcomes_A * total_outcomes_B - favorable_outcomes_B * total_outcomes_A) / (total_outcomes_A * total_outcomes_B);

  % Print the result
  printf('%.15g\n', probability);
endfunction

% Call the function to calculate and print the probability
calculate_probability();

