  % Initialize variables
  sum = 0;
  count = 0;

  % Loop through all two-digit numbers
  for i = 10:99
    % Check if the number is a multiple of 7
    if mod(i, 7) == 0
      % Check if the sum of its digits is 10
      if sum(i) == 10
        % Add the number to the sum and increment the count
        sum = sum + i;
        count = count + 1;
      endif
    endif
  endfor

