% Calculate the total number of ways to draw 3 balls from 5
total_combinations = nchoosek(total_balls, balls_drawn);

% Calculate the number of ways to draw 3 balls such that their sum is odd
odd_combinations = 0;
for i = 1:total_balls
  for j = i+1:total_balls
    for k = j+1:total_balls
      if (i + j + k) % 2 == 1
        odd_combinations++;
      endif
    endfor
  endfor
endfor

% Calculate the probability
probability = odd_combinations / total_combinations;

% Print the result
printf('%.15g\n', probability);

