function result = solve_problem()
  % Define the range of possible values for x, y, and z
  x_range = -100:100;
  y_range = -100:100;
  z_range = -100:100;

  % Initialize a counter for distinct values of x+y+z
  distinct_values = 0;

  % Loop through all possible values of x, y, and z
  for x = x_range
    for y = y_range
      for z = z_range
        % Check if x, 1/x, y, 1/y, z, and 1/z are all integers
        if isint(x) && isint(1/x) && isint(y) && isint(1/y) && isint(z) && isint(1/z)
          % If so, increment the counter for distinct values of x+y+z
          distinct_values = distinct_values + 1;
        endif
      endfor
    endfor
  endfor

  % Print the final answer
  printf('%.15g\n', distinct_values);
endfunction

% Call the function to solve the problem
solve_problem();

