function result = next_year_on_mars(year)
  # Calculate the day of the week for the first day of the next year
  day_of_week = mod(year * 697, 12);

  # Find the next year that starts on the first day of the week
  while day_of_week != 0
    year += 1;
    day_of_week = mod(year * 697, 12);
  endwhile

  result = year;
endfunction

