function max_value = solve_max_value()
  % Define the problem as a nonlinear optimization problem
  f = @(x) x(1)*x(2) + x(2)*x(3) + x(3)*x(4);
  g = @(x) x(1) + x(2) + x(3) + x(4) - 1;
  lb = [0, 0, 0, 0];
  ub = [1, 1, 1, 1];

  % Use fmincon to solve the optimization problem
  options = optimoptions('fmincon','Display','iter','Algorithm','interior-point');
  x0 = [0.25, 0.25, 0.25, 0.25]; % Initial guess
  [x,fval] = fmincon(f,x0,[],[],[],[],lb,ub,g,options);

  % Print the maximum value
  printf('%.15g\n', fval);
end

solve_max_value();

