function count = solve_log_equation()
  % Define the function f(x) = log(kx) - 2*log(x+2)
  f = @(x) log(k*x) - 2*log(x+2);

  % Define the interval [-500, 500]
  interval = [-500, 500];

  % Initialize the count of valid k values
  count = 0;

  % Loop through all integer values of k in the interval
  for k = interval
    % Check if the function has exactly one real solution
    if length(fzero(f, interval)) == 1
      % Increment the count if the function has exactly one real solution
      count = count + 1;
    end
  end

  % Print the final answer
  printf('%.15g\n', count);
end

% Call the function
solve_log_equation();

