function result = calculate_probability()
  % Define the possible outcomes for each spin
  outcomes = {'arm', 'leg', 'red', 'blue', 'green', 'yellow'};

  % Calculate the total number of possible outcomes for four spins
  total_outcomes = length(outcomes)^4;

  % Calculate the number of favorable outcomes
  favorable_outcomes = 0;
  for i = 1:4
    for j = 1:4
      for k = 1:4
        for l = 1:4
          if (outcomes{i} == 'arm' && outcomes{j} == 'arm' && outcomes{k} == 'arm' && outcomes{l} == 'leg')
            if (outcomes{i} == 'red' && outcomes{j} == 'red' && outcomes{k} == 'red' && outcomes{l} == 'blue')
              favorable_outcomes++;
            end
          end
        end
      end
    end
  end

  % Calculate the probability
  result = favorable_outcomes / total_outcomes;
end

printf('%.15g\n', calculate_probability());

