function divisors_of_6n()
  n = 1;
  while true
    if divisors(2*n) == 28 && divisors(3*n) == 30
      printf('%.15g\n', divisors(6*n));
      break;
    endif
    n = n + 1;
  endwhile
endfunction

function divisors(n)
  divisors = 0;
  for i = 1:n
    if mod(n, i) == 0
      divisors = divisors + 1;
    endif
  endfor
  return divisors;
endfunction

