function [value] = reverse_base_number(base3, base4)
  # Convert base3 and base4 to base 10
  base3_decimal = base3 * 3^2 + base3 * 3^1 + base3 * 3^0;
  base4_decimal = base4 * 4^2 + base4 * 4^1 + base4 * 4^0;

  # Check if the base3 and base4 are reversed
  if (base3_decimal == base4_decimal)
    value = base3_decimal;
  else
    value = -1;
  endif
endfunction

# Loop through all possible base3 numbers
for base3 = 0:2
  for base4 = 0:3
    value = reverse_base_number(base3, base4);
    if (value != -1)
      printf('%.15g\n', value);
    endif
  endfor
endfor
