function [n] = find_nth_term(n)
  % Initialize variables
  count = 0;
  i = 2;

  % Loop until the count reaches the desired term
  while count < n
    % Check if i is a square, cube, or fifth power
    if is_square(i) || is_cube(i) || is_fifth_power(i)
      % If it is, increment i and continue to the next iteration
      i++;
      continue;
    endif

    % If it's not, increment the count and add i to the sequence
    count++;
    sequence(count) = i;
    i++;
  endwhile

  % Return the nth term of the sequence
  n = sequence(n);
endfunction

function [is_square] = is_square(n)
  % Check if n is a square number
  is_square = (sqrt(n) == floor(sqrt(n)));
endfunction

function [is_cube] = is_cube(n)
  % Check if n is a cube number
  is_cube = (cbrt(n) == floor(cbrt(n)));
endfunction

function [is_fifth_power] = is_fifth_power(n)
  % Check if n is a fifth power number
  is_fifth_power = (n^(1/5) == floor(n^(1/5)));
endfunction

% Call the function to find the 1000th term of the sequence
n = find_nth_term(1000);
printf('%.15g\n', n);

