#!/usr/bin/octave -qf

% Define the wheel numbers
wheel_numbers = [1, 2, 6, 9, 3, 7];

% Generate all possible outcomes of spinning the wheel twice
all_outcomes = wheel_numbers' * ones(1, length(wheel_numbers));

% Calculate the remainders when the first number is divided by 4 and the second number is divided by 5
remainders = mod(all_outcomes, 4) + 1;
remainders = mod(all_outcomes(2, :), 5) + 1;

% Determine the shaded squares based on the remainders
shaded_squares = (remainders == 1) & (remainders == 2) & (remainders == 3) & (remainders == 4);

% Calculate the probability of landing on a shaded square
probability = sum(shaded_squares) / length(shaded_squares);

% Print the final answer
printf('%.15g\n', probability);

