  x = 1:100;
  y = 1:99;
  z = 1:98;

  % Initialize the minimum value
  min_value = inf;

  % Loop through the domain
  for i = 1:length(x)
    for j = 1:length(y)
      for k = 1:length(z)
        % Calculate the function value
        value = f(x(i), y(j), z(k));

        % Update the minimum value
        if value < min_value
          min_value = value;
        end
      end
    end
  end

  % Print the minimum value
  printf('%.15g\n', min_value);
end

