function result = solve_bead_problem()
  % Define the grid size
  grid_size = 3;

  % Define the number of beads
  num_beads = 9;

  % Define the number of colors
  num_colors = 9;

  % Define the number of ways to place the purple and green beads
  num_ways_purple_green = 0;

  % Define the number of ways to place the remaining beads
  num_ways_remaining = 0;

  % Define the number of ways to place the purple and green beads
  for i = 1:grid_size
    for j = 1:grid_size
      if i == j
        num_ways_purple_green += (num_colors - 2) * (num_colors - 1);
      else
        num_ways_purple_green += (num_colors - 2) * (num_colors - 1);
      endif
    endfor
  endfor

  % Define the number of ways to place the remaining beads
  for i = 1:grid_size
    for j = 1:grid_size
      if i == j
        num_ways_remaining += (num_colors - 2) * (num_colors - 1);
      else
        num_ways_remaining += (num_colors - 2) * (num_colors - 1);
      endif
    endfor
  endfor

  % Define the total number of ways to place the beads
  total_ways = num_ways_purple_green * num_ways_remaining;

  % Define the final answer
  result = total_ways;

  % Print the final answer
  printf('%.15g\n', result);
endfunction

% Call the function
