  # If it is, print the compound interest rate
  printf('%.15g\n', compound_interest_rate);
else
  # If it is not, increase the compound interest rate and try again
  compound_interest_rate = compound_interest_rate + 0.01;
  total_amount = initial_amount + annual_wage * (1 + compound_interest_rate)^num_years;
  if total_amount >= target_amount
    printf('%.15g\n', compound_interest_rate);
  else
    # If the total amount is still not greater than or equal to the target amount, repeat the process
    while total_amount < target_amount
      compound_interest_rate = compound_interest_rate + 0.01;
      total_amount = initial_amount + annual_wage * (1 + compound_interest_rate)^num_years;
    end
    printf('%.15g\n', compound_interest_rate);
  end
end

