function result = solve_quadratic_equation()
  % Define the quadratic equation
  a = 1;
  b = 1;
  c = 1;

  % Calculate the discriminant
  discriminant = b^2 - 4*a*c;

  % Check if the discriminant is non-negative
  if discriminant >= 0
    % Calculate the roots
    root1 = (-b + sqrt(discriminant)) / (2*a);
    root2 = (-b - sqrt(discriminant)) / (2*a);

    % Check if the roots are equal
    if root1 == root2
      % If the roots are equal, there is only one ordered pair
      result = 1;
    else
      % If the roots are not equal, there are two ordered pairs
      result = 2;
    end
  else
    % If the discriminant is negative, there are no real roots
    result = 0;
  end
end

% Call the function and print the result
printf('%.15g\n', solve_quadratic_equation());

