period_length = 16;

% Calculate the starting index of the period
start_index = remainder + 1;

% Calculate the ending index of the period
end_index = start_index + period_length - 1;

% Calculate the value of the period
period = value(start_index:end_index);

% Calculate the value of the 4037th digit
digit = period(remainder + 1);

% Print the value of the 4037th digit
printf('%.15g\n', digit)
```

