#!/usr/bin/octave -qf

function [avg] = smallest_average(n)
  % Initialize the set S with the smallest and largest elements
  S = [0, 2015];

  % Calculate the sum of the elements in S
  sum_S = sum(S);

  % Calculate the average of the elements in S
  avg = sum_S / length(S);

  % Loop through the remaining elements in the set
  for i = 1:n-2
    % Add the next element to the set
    S = [S, i];

    % Calculate the new sum of the elements in S
    new_sum_S = sum(S);

    % Calculate the new average of the elements in S
    new_avg = new_sum_S / length(S);

    % If the new average is smaller than the current average, update the average
    if new_avg < avg
      avg = new_avg;
    end
  end

  % Return the smallest possible average
  return
end

% Call the function with the number of elements in the set
avg = smallest_average(2016);

% Print the final answer
printf('%.15g\n', avg);

