#!/usr/bin/octave -qf

function result = factorial(n)
  result = 1;
  for i = 1:n
    result = result * i;
  endfor
endfunction

function result = permutations(n, k)
  result = factorial(n) / factorial(n - k);
endfunction

function result = count_permutations(word)
  unique_letters = unique(word);
  total_letters = length(unique_letters);
  total_permutations = permutations(length(word), length(word));
  for i = 1:length(unique_letters)
    count = sum(word == unique_letters(i));
    total_permutations = total_permutations / permutations(count, count);
  endfor
  printf('%.15g\n', total_permutations);
endfunction

count_permutations('PARABOLA');

