size(150);
import graph;
pair J = (0,0), H = (6,0), O, N;
path circ = Circle(J,3);
pair M = midpoint(J--H);
path secCirc = Circle(M,3);
pair[] tangentPoints = intersectionpoints(circ,secCirc);
O = tangentPoints[0]; N = tangentPoints[1];
draw(J--N--H--O--cycle);
draw(circ);
label("$H$",H,E);
label("$J$",J,W);
label("$N$",N,S);
label("$O$",O,NE);
[/asy]

octave_code:
% Define the radius of the circle
r = 3;

% Define the coordinates of points J and H
J = [0, 0];
H = [6, 0];

% Calculate the midpoint of JH
M = (J + H) / 2;

% Calculate the coordinates of points O and N
O = r * (J - M) / norm(J - M) + M;
N = r * (H - M) / norm(H - M) + M;

% Calculate the angles mangle J and mangle H
mangle_J = atan2(O(2), O(1)) * 180 / pi;
mangle_H = atan2(N(2), N(1)) * 180 / pi;

% Calculate the sum of the angles
sum_angles = mangle_J + mangle_H;

% Print the final answer
printf('%.15g\n', sum_angles);

