#!/usr/bin/octave -qf

# Define the function to check if a number is prime
function is_prime = is_prime_number(n)
  if n < 2
    is_prime = 0;
  else
    is_prime = 1;
    for i = 2:floor(sqrt(n))
      if mod(n, i) == 0
        is_prime = 0;
        break;
      endif
    endfor
  endif
endfunction

# Find the 5 smallest prime numbers
primes = [];
i = 2;
while length(primes) < 5
  if is_prime_number(i)
    primes = [primes i];
  endif
  i++;
endwhile

# Calculate the product of the 5 smallest prime numbers
product = 1;
for i = primes
  product *= i;
endfor

# Calculate the remainder when the product is divided by 42
remainder = mod(product, 42);

# Print the result
printf('%.15g\n', remainder);

