function count_sequences(sum)
  count = 0;
  for p1 = 2:sum-2
    if is_prime(p1)
      for p2 = p1+1:sum-1
        if is_prime(p2)
          for p3 = p2+1:sum
            if is_prime(p3) && p1 + p2 + p3 == sum
              count++;
            endif
          endfor
        endif
      endfor
    endif
  endfor
  printf('%.15g\n', count);
endfunction

count_sequences(20);
