function y = curve(x)
  y = sqrt(x^2 - 16);
endfunction

% Define the function for the area under the curve
function A = area_under_curve(a, b, n)
  h = (b - a) / n;
  x = a:h:b;
  y = curve(x);
  A = sum(y) * h;
endfunction

% Calculate the area of the region formed by the curve
a = 4;
b = 25/4;
n = 10000;
A = area_under_curve(a, b, n);

% Print the final answer
printf('%.15g\n', A)
```

