octave_code:
function count_rectangles()
  % Define the grid dimensions
  grid_size = 6;

  % Initialize the count of rectangles
  count = 0;

  % Loop through all possible rectangle dimensions
  for width = 1:grid_size
    for height = 1:grid_size
      % Calculate the area of the rectangle
      area = width * height;

      % Check if the area is 3 square units
      if area == 3
        % Increment the count of rectangles
        count = count + 1;
      end
    end
  end

  % Print the final answer
  printf('%.15g\n', count);
end

% Call the function
count_rectangles();

