function result = solve_problem()
  % Initialize variables
  n = 3;
  count = 0;

  % Loop through all possible values of n
  while n >= 3
    % Initialize x with zeros
    x = zeros(1, n);

    % Loop through all possible values of x
    for i = 1:n
      x(i) = rand();
    end

    % Check if the sum of x is 0
    if sum(x) == 0
      % Check if the sum of products of adjacent x is less than or equal to 0
      if sum(x(1:end-1).*x(2:end)) + x(end)*x(1) <= 0
        count = count + 1;
      end
    end

    % Increment n
    n = n + 1;
  end

  % Print the result
  printf('%.15g\n', count);
end

solve_problem();

