%!/usr/bin/octave -qf

% Define the function to find the smallest possible number of leaves
function leaves = find_smallest_leaves()
  % Initialize the number of leaves to 101
  leaves = 101;

  % Loop until the number of leaves is greater than 100
  while leaves > 100
    % Calculate the number of pages
    pages = leaves * 2;

    % Check if the number of pages is 3 more than a multiple of 7
    if mod(pages, 7) == 3
      % If the number of pages is 3 more than a multiple of 7, break the loop
      break;
    endif

    % Increment the number of leaves
    leaves = leaves + 1;
  endwhile

  % Return the smallest possible number of leaves
  return;
endfunction

% Call the function to find the smallest possible number of leaves
leaves = find_smallest_leaves();

% Print the smallest possible number of leaves
printf('%.15g\n', leaves);

