#!/usr/bin/octave -qf

function result = calculate_combinations(n, k)
  result = factorial(n) / (factorial(k) * factorial(n - k));
endfunction

function result = calculate_total_combinations(n, k)
  result = sum(calculate_combinations(n, k) for k = 0:n);
endfunction

function result = calculate_distinguishable_combinations(n, k)
  result = calculate_total_combinations(n, k) * factorial(k);
endfunction

function result = calculate_box_combinations(n, k)
  result = calculate_distinguishable_combinations(n, k) * factorial(k);
endfunction

function result = calculate_ball_combinations(n, k)
  result = calculate_box_combinations(n, k) * factorial(k);
endfunction

function result = calculate_final_combinations(n, k)
  result = calculate_ball_combinations(n, k) * factorial(k);
endfunction

