function count_sums()
  % Define the set
  set = [0, 1, 2, 4, 8, 16];

  % Initialize the count of sums
  count = 0;

  % Loop through all possible combinations of the set
  for i = 1:length(set)
    for j = i:length(set)
      % Calculate the sum of the current combination
      sum = set(i) + set(j);

      % Check if the sum is unique
      if ~ismember(sum, set)
        % Increment the count of sums
        count = count + 1;
      end
    end
  end

  % Print the final answer
  printf('%.15g\n', count);
end

% Call the function
count_sums();

