function result = count_paths(w, h)
  % Initialize the grid with zeros
  grid = zeros(h, w);

  % Set the starting point to 1
  grid(1, 1) = 1;

  % Iterate through the grid
  for i = 1:h
    for j = 1:w
      % If the current cell is not the end point
      if i < h && j < w
        % Calculate the number of paths to the current cell
        grid(i+1, j) = grid(i+1, j) + grid(i, j);
        grid(i, j+1) = grid(i, j+1) + grid(i, j);
      end
    end
  end

  % Return the number of paths to the end point
  result = grid(h, w);
end

% Call the function with the given grid dimensions
printf('%.15g\n', count_paths(6, 3));

