#!/usr/bin/octave -qf

# Convert base 8 numbers to base 10
num1 = base8_to_base10(6);
num2 = base8_to_base10(7);

# Multiply the base 10 numbers
result = num1 * num2;

# Convert the result back to base 8
final_result = base10_to_base8(result);

# Print the final result
printf('%.15g\n', final_result);

# Function to convert base 8 to base 10
function base8_to_base10(num)
  base10 = 0;
  for i = 1:length(num)
    base10 = base10 + str2double(num(i)) * (8 ^ (length(num) - i));
  endfor
  return base10;
endfunction

# Function to convert base 10 to base 8
function base10_to_base8(num)
  base8 = '';
  while num > 0
    base8 = strcat(base8, num2str(mod(num, 8)));
    num = floor(num / 8);
  endwhile
  return base8;
endfunction
